import React, { useState } from 'react';

const DynamicForm = () => {
  const [url, setUrl] = useState('');
  const [firstOption, setFirstOption] = useState('');
  const [secondOptions, setSecondOptions] = useState([]);
  const [secondOption, setSecondOption] = useState('');

  const handleFirstOptionChange = (e) => {
    const selectedOption = e.target.value;
    setFirstOption(selectedOption);

    // Update secondOptions based on the firstOption
    switch (selectedOption) {
      case 'option1':
        setSecondOptions(['subOption1', 'subOption2']);
        break;
      case 'option2':
        setSecondOptions(['subOption3', 'subOption4']);
        break;
      case 'option3':
        setSecondOptions(['subOption5', 'subOption6']);
        break;
      case 'option4':
        setSecondOptions(['subOption7', 'subOption8']);
        break;
      case 'option5':
        setSecondOptions(['subOption9', 'subOption10']);
        break;
      default:
        setSecondOptions([]);
    }
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission
    console.log('URL:', url);
    console.log('First Option:', firstOption);
    console.log('Second Option:', secondOption);
  };

  return (
    <form onSubmit={handleSubmit}>
      <div>
        <label>URL:</label>
        <input
          type="url"
          value={url}
          onChange={(e) => setUrl(e.target.value)}
          required
        />
      </div>
      <div>
        <label>First Option:</label>
        <select value={firstOption} onChange={handleFirstOptionChange} required>
          <option value="">Select an option</option>
          <option value="option1">Option 1</option>
          <option value="option2">Option 2</option>
          <option value="option3">Option 3</option>
          <option value="option4">Option 4</option>
          <option value="option5">Option 5</option>
        </select>
      </div>
      {firstOption && (
        <div>
          <label>Second Option:</label>
          <select value={secondOption} onChange={(e) => setSecondOption(e.target.value)} required>
            <option value="">Select an option</option>
            {secondOptions.map((option, index) => (
              <option key={index} value={option}>{option}</option>
            ))}
          </select>
        </div>
      )}
      <button type="submit">Generate Report</button>
    </form>
  );
};

export default DynamicForm;
